import React from 'react';
import { Btn } from './Button';
import { useCart } from "react-use-cart";

const CartList = () => {
    const {total,
    elements
    } = useCart();
    return (
        <section className='cart-list'>
            <div className='container'>
                <h5>
                    your cart
                </h5>
                <div className='light-cart-list'>
                    <div className='box-light-cart-list'>
                        {elements.map((element, index) => {})}
                        <img src={ this.props.image } alt={ this.props.image } />
                        <span>
                            { this.props.name }
                        </span>
                        <span>
                            01
                        </span>
                        <span>
                        { this.props.price }
                        </span>
                        <Btn classbtn="main-btn-light-bc-cart-list" text="check out"/>
                    </div>
                </div>
                <div className='dark-cart-list'>
                    <div className='box-dark-cart-list'>
                        <span>
                            all items
                        </span>
                        <div></div>
                        <span>
                            06
                        </span>
                        <span>
                            ({total})
                        </span>
                        <Btn classbtn="main-btn-dark-bc" text="check out all"/>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default CartList;
